import logo from './logo.svg';
import './App.css';
import HomePage from './HomePage';
import { BrowserRouter as Router, Route } from 'react-router-dom';

function App() {
  return (
      <Router>
        <Routes>
      <div className="App">
        <header className="App-header">
          <Route exact path="/" component={HomePage} />
        </header>
      </div>
      </Routes>
    </Router>
  );
}

export default App;
